import React, { Component } from 'react';
import Layout from './Layout';

import WebFont from 'webfontloader';

WebFont.load({
  google: {
    families: ['Montserrat:ital,wght@0,200;0,400;0,700;0,900;1,400', 'sans-serif'],
  },
});

export default class index extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <Layout>
      </Layout>
    );
  }
}
